import React from 'react';
import { View, Text, Image, TouchableOpacity } from 'react-native';

const ProfileComponent = () => {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <View style={{ marginBottom: 20 }}>
        <Image
          source={{ uri: 'https://scontent.fadb6-2.fna.fbcdn.net/v/t39.30808-6/397184795_2639576499532444_7002150714775468708_n.jpg?stp=dst-jpg_fb50_s320x320&_nc_cat=103&ccb=1-7&_nc_sid=783fdb&_nc_ohc=lLVZv-cNFUYAX9xz1hl&_nc_ht=scontent.fadb6-2.fna&oh=00_AfAOrbBYLOD50SO39dPmqb7jNeze9ntr7O7-j-JtiFbPIw&oe=65CBC063' }}
          style={{ width: 200, height: 200, borderRadius: 100 }}
        />
      </View>
      <TouchableOpacity onPress={() => {}}>
        <Text style={{ fontSize: 16, color: '#1877f2' }}>Kapak Fotoğrafını Düzenle</Text>
      </TouchableOpacity>
      <View style={{ marginTop: 20 }}>
        <Text style={{ fontSize: 24, fontWeight: 'bold' }}>Filiz Çürükcü</Text>
        <Text>386 arkadaş</Text>
      </View>
      <View style={{ marginTop: 20 }}>
        {/* Diğer işlemler için butonlar buraya eklenebilir */}
      </View>
    </View>
  );
};

export default ProfileComponent;
